[{"location":"ExampleContinuum.html#Example-2D-continuum-simulation","page":"Example 2D continuum simulation","title":"Example 2D continuum simulation","text":"","category":"section"},{"location":"ExampleContinuum.html#Cartesian-simulation-code:","page":"Example 2D continuum simulation","title":"Cartesian simulation code:","text":"","category":"section"},{"location":"ExampleContinuum.html","page":"Example 2D continuum simulation","title":"Example 2D continuum simulation","text":"%```@example sim2Dcontiuumcartesian %using TissueGrowth %# simulation parameters %D = 0.0015; %kf = 0.005; %A = 0.00; %ρ₀ = 14; %growth_dir = \"inward\" %Tmax = 50.0 %Xmax = 2π","category":"page"},{"location":"ExampleContinuum.html","page":"Example 2D continuum simulation","title":"Example 2D continuum simulation","text":"%x,h,ρ = TissueGrowth.FDSolveContinuumLimCartesian(D,kf,A,ρ₀,growth_dir,Tmax,Xmax);","category":"page"},{"location":"ExampleContinuum.html","page":"Example 2D continuum simulation","title":"Example 2D continuum simulation","text":"%cmap = :jet %f = TissueGrowth.plotContinuumResults_Cartesian(x, h, ρ, cmap, D, kf) %```","category":"page"},{"location":"ExampleContinuum.html#Polar-simulation-code:","page":"Example 2D continuum simulation","title":"Polar simulation code:","text":"","category":"section"},{"location":"ExampleContinuum.html","page":"Example 2D continuum simulation","title":"Example 2D continuum simulation","text":"using TissueGrowth\n# simulation parameters\nD = 0.0015;\nkf = 0.001;\nA = 0.00;\nρ₀ = 14;\ngrowth_dir = \"inward\";\nbtype = \"hex\"\nTmax = 30.0;\nr₀ = 1.05\n\nθ,R,ρ = TissueGrowth.FD_SolveContinuumLim_Polar(D,kf,A,ρ₀,Tmax,r₀,btype,growth_dir);\n\ncmap = :jet\nf = TissueGrowth.plotContinuumResults_Polar(θ, R, ρ, cmap, D, kf)","category":"page"},{"location":"ExampleDiscrete.html#Example-2D-discrete-simulation","page":"Example 2D discrete simulation","title":"Example 2D discrete simulation","text":"","category":"section"},{"location":"ExampleDiscrete.html#Non-Stochastic-Simulation-Code:","page":"Example 2D discrete simulation","title":"Non-Stochastic Simulation Code:","text":"","category":"section"},{"location":"ExampleDiscrete.html","page":"Example 2D discrete simulation","title":"Example 2D discrete simulation","text":"using TissueGrowth\n\n# set random seed number for reproducability \nseed = 88\n\n# setting up simulation parameters\nN = 180 # number of cells\nm = 1 # number of springs per cell\nR₀ = 1.0  # shape radius\nD = [0.0001, 0.0075, 0.015]\nl₀ = 1.0\nkf = 0.0008\nη = 1.0 \ngrowth_dir = \"inward\" # Options: \"inward\", \"outward\"\nTmax = 21.0 # days\nδt = 0.01\nbtypes = [\"circle\"] #Options: [\"circle\", \"triangle\", \"square\", \"hex\", \"star\",\"cross\"]\ndist_type = \"Linear\" #Options: [\"Linear\", \"sigmoid\", \"2sigmoid\", \"exp\",  \"sine\", \"cosine\", \"quad\", \"cubic\"]\n\n# Cell Behaviours\nprolif = false;    death = false;  embed = false;\nα = 0.0001;        β = 0.001;      γ = 0.01;\nevent_δt = δt\n\n# 2D simulations \nsols2D, Q, R = TissueGrowth.sim2D(N,m,R₀,D,l₀,kf,η,growth_dir,Tmax,δt,btypes,dist_type,\n            prolif, death, embed, α, β, γ, event_δt, seed, 11);\n\ncmap = :jet\n\ngeo = 1 # indexing through `btypes`\ndiffusivity = 1 # indexing through `D`\nDensity_Range = (10,30)\nTissueGrowth.plotResults2D(sols2D[diffusivity][geo].u, sols2D[diffusivity][geo].Density, cmap, Density_Range, \"Density ρ\", D[diffusivity], kf)\n","category":"page"},{"location":"ExampleDiscrete.html#Stochastic-Simulation-Code:","page":"Example 2D discrete simulation","title":"Stochastic Simulation Code:","text":"","category":"section"},{"location":"ExampleDiscrete.html","page":"Example 2D discrete simulation","title":"Example 2D discrete simulation","text":"using TissueGrowth\n\n# set random seed number for reproducability \nseed = 88\n\n# setting up simulation parameters\nN = 180 # number of cells\nm = 1 # number of springs per cell\nR₀ = 1.0  # shape radius\nD = [0.0001, 0.0075, 0.015]\nl₀ = 1.0\nkf = 0.0008\nη = 1.0 \ngrowth_dir = \"inward\" # Options: \"inward\", \"outward\"\nTmax = 21.0 # days\nδt = 0.01\nbtypes = [\"circle\"] #Options: [\"circle\", \"triangle\", \"square\", \"hex\", \"star\",\"cross\"]\ndist_type = \"Linear\" #Options: [\"Linear\", \"sigmoid\", \"2sigmoid\", \"exp\",  \"sine\", \"cosine\", \"quad\", \"cubic\"]\n\n# Cell Behaviours\nprolif = true;     death = true;    embed = false;\nα = 0.0001;        β = 0.001;      γ = 0.01;\nevent_δt = δt\n\n# 2D simulations \nsols2D, Q, R = TissueGrowth.sim2D(N,m,R₀,D,l₀,kf,η,growth_dir,Tmax,δt,btypes,dist_type,\n            prolif, death, embed, α, β, γ, event_δt, seed, 11);\n\ncmap = :jet\n\ngeo = 1 # indexing through `btypes`\ndiffusivity = 1 # indexing through `D`\nDensity_Range = (10,30)\nTissueGrowth.plotResults2D(sols2D[diffusivity][geo].u, sols2D[diffusivity][geo].Density, cmap, Density_Range, \"Density ρ\", D[diffusivity], kf)\n","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"CurrentModule = TissueGrowth","category":"page"},{"location":"ForUser.html#User-Set-Parameters","page":"User Set Parameters","title":"User Set Parameters","text":"","category":"section"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"N: Number of cells in the simulation. [Integer]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"m: Number of springs per cell. [Integer]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"R₀: Radius or characteristic length of the initial shape. [Float]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"D: Array of diffuision coefficients used to calculate cell stiffness. [Float]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"l₀: Resting length of the spring per cell. [Float]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"kf: Tissue production rate per cell. [Float]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"η: Viscosity or damping coefficient per cell. [Float]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"growth_dir: Direction of tissue growth (Options: 'inward' or 'outward'). [String]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"Tmax: Total simulation time (in days). [Float]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"δt: Time step for the numerical integration. [Float]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"btypes: Types of boundary conditions (Options: \"Sinewave\" (1D only), \"circle\", \"triangle\", \"square\", \"hex\", \"star\", \"cross\"). [String]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"dist_type: Distribution type for node placement (\"Linear\", \"sigmoid\", \"2sigmoid\", \"exp\",  \"sine\", \"cosine\", \"quad\", \"cubic\"). [String]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"prolif, death, embed: Boolean flags indicating cell behaviors. [Boolean]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"α, β, γ: Parameters for cell behaviors. [Float]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"event_δt: Time interval for periodic callback events. [Float]","category":"page"},{"location":"ForUser.html","page":"User Set Parameters","title":"User Set Parameters","text":"The stochastic cell behaviour has not been implemented in the 1D simulation code therefore a set of parameters would not be set/ required to run those simulations.","category":"page"},{"location":"Equations.html#System-of-ODEs-(Discrete-Model)","page":"System of ODEs (Discrete Model)","title":"System of ODEs (Discrete Model)","text":"","category":"section"},{"location":"Equations.html#Index","page":"System of ODEs (Discrete Model)","title":"Index","text":"","category":"section"},{"location":"Equations.html","page":"System of ODEs (Discrete Model)","title":"System of ODEs (Discrete Model)","text":"","category":"page"},{"location":"Equations.html#Data-Structure","page":"System of ODEs (Discrete Model)","title":"Data Structure","text":"","category":"section"},{"location":"Equations.html","page":"System of ODEs (Discrete Model)","title":"System of ODEs (Discrete Model)","text":"TissueGrowth.SimResults_t","category":"page"},{"location":"Equations.html#TissueGrowth.SimResults_t","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.SimResults_t","text":"SimResults_t\n\nA data structure representing the results of a simulation which can then be used for visualisation with the plotting code PlottingFncs1D.jl and PlottingFncs2D.jl.\n\nThis structure contains various fields that store the results and relevant data from a simulation process. It includes the type of simulation, time steps, state vectors, forces, densities, and other relevant quantities.\n\nFields\n\nbtype: A String indicating the type of simulation or boundary condition.\nt: A Vector{Float64} representing the time steps at which the simulation results are recorded.\nu: A Vector of ElasticMatrix{Float64,Vector{Float64}} representing the state of the system at each time step.\n∑F: A Vector of ElasticVector{Float64,Vector{Float64}}, representing the sum of forces at each time step.\nDensity: A Vector of ElasticMatrix{Float64,Vector{Float64}} representing the density of the system at each time step.\nVₙ: A Vector{Vector{Float64}} representing the normal velocity at each time step.\nΩ: A Vector{Float64} representing the void area within the pore at each time step.\nψ: A Vector of ElasticMatrix{Float64,Vector{Float64}}, representing the stress of the springs/ cells at each time step.\nΚ: A Vector of ElasticMatrix{Float64,Vector{Float64}}, representing the approximate curvature of the moving boundary at each time step.\nCellCount: A Vector{Int64} representing the amount of active cells at a give time t.\n\n\n\n\n\n","category":"type"},{"location":"Equations.html#1D-simulation-code:","page":"System of ODEs (Discrete Model)","title":"1D simulation code:","text":"","category":"section"},{"location":"Equations.html","page":"System of ODEs (Discrete Model)","title":"System of ODEs (Discrete Model)","text":"TissueGrowth.sim1D(N,m,R₀,D,l₀,kf,η,growth_dir,Tmax,δt,btype,dist_type)","category":"page"},{"location":"Equations.html#TissueGrowth.sim1D-NTuple{12, Any}","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.sim1D","text":"sim1D()\n\nExecute a series of 1D mechanical relaxation simulations.\n\nThis function sets up and runs a series of 1D simulations for different stiffness values. It iterates over an array of stiffness coefficients, sets up the corresponding ODE problem for each case, solves it, and collects the results.\n\nSimulation Parameters\n\nN: Number of cells in the simulation.\nm: Number of springs per cell.\nM: Total number of springs along the interface.\nR₀: Radius or characteristic length of the initial shape.\nD: Array of diffuision coefficients used to calculate cell stiffness.\nl₀: Resting length of the spring per cell.\nkf: Tissue production rate per cell.\nη: Viscosity or damping coefficient per cell.\nTmax: Total simulation time (in days).\nδt: Time step for the Euler integration.\ngrowth_dir: Growth direction for the simulation ('1D').\nbtype: Type of boundary condition ('SineWave').\nsavetimes: Time points at which to save the simulation results.\n\nReturns\n\nA vector of SimResults_t objects, each representing the simulation results for a different stiffness coefficient.\n\n\n\n\n\n","category":"method"},{"location":"Equations.html#2D-simulation-code:","page":"System of ODEs (Discrete Model)","title":"2D simulation code:","text":"","category":"section"},{"location":"Equations.html","page":"System of ODEs (Discrete Model)","title":"System of ODEs (Discrete Model)","text":"TissueGrowth.sim2D(N,m,R₀,D,l₀,kf,η,growth_dir,Tmax,δt,btypes,dist_type, \n                prolif, death, embed, α, β, γ, event_δt, seed, NumSaveTimePoints)","category":"page"},{"location":"Equations.html#TissueGrowth.sim2D-NTuple{21, Any}","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.sim2D","text":"sim2D(N,m,R₀,D,l₀,kf,η,growth_dir,Tmax,δt,btypes,dist_type,prolif,death,embed,α,β,γ,event_δt,seed)\n\nExecute a series of 2D mechanical relaxation simulations.\n\nThis function sets up and runs 2D simulations for different stiffness coefficients and boundary types. It iterates over arrays of stiffness coefficients and boundary types, sets up the corresponding ODE problem for each case, solves it using a specified numerical method with periodic callbacks, and collects the results.\n\nSimulation Parameters\n\nN: Number of cells in the simulation.\nm: Number of springs per cell.\nR₀: Radius or characteristic length of the initial shape.\nD: Array of diffuision coefficients used to calculate cell stiffness.\nl₀: Resting length of the spring per cell.\nkf: Tissue production rate per cell.\nη: Viscosity or damping coefficient per cell.\ngrowth_dir: Direction of tissue growth ('inward' or 'outward').\nTmax: Total simulation time (in days).\nδt: Time step for the numerical integration.\nbtypes: Types of boundary conditions (e.g., 'circle', 'triangle').\ndist_type: Distribution type for node placement (e.g., 'Linear', 'sigmoid').\nprolif, death, embed: Boolean flags indicating cell behaviors.\nα, β, γ: Parameters for cell behaviors.\nevent_δt: Time interval for periodic callback events.\nseed: Seed number for reproducability with stochastic simulations.\n\nReturns\n\nA vector of vectors of SimResults_t objects. Each inner vector represents the simulation results for different boundary types under a specific stiffness coefficient.\n\nExample\n\nall_results = sim2D(N,m,R₀,D,l₀,kf,η,growth_dir,Tmax,δt,btypes,dist_type,\n                        prolif, death, embed, α, β, γ, event_δt, seed);\n\n\n\n\n\n","category":"method"},{"location":"Equations.html#ODE-Problem:","page":"System of ODEs (Discrete Model)","title":"ODE Problem:","text":"","category":"section"},{"location":"Equations.html","page":"System of ODEs (Discrete Model)","title":"System of ODEs (Discrete Model)","text":"TissueGrowth.ODE_fnc_1D!(du,u,p,t) \nTissueGrowth.ODE_fnc_2D!(du,u,p,t) ","category":"page"},{"location":"Equations.html#TissueGrowth.ODE_fnc_1D!-NTuple{4, Any}","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.ODE_fnc_1D!","text":"ODE_fnc_1D!(du, u, p, t)\n\nDefine the ODE system for 1D mechanical relaxation with initial conditions. This function computes the derivatives du based on the current state u and parameters p. In this system there is a periodic boundary condition such that x ∈ [0,2π] with i spring boundary nodes and u₋₁ = uₙ, uₙ₊₁ = u₁\n\nArguments\n\ndu: Array to store the derivatives of u.\nu: Current state array.\np: Parameters tuple (N, kₛ, η, kf, l₀, δt, growth_dir).\nt: Current time.\n\nDescription\n\nCalculates the mechanical relaxation and normal velocity in a 1D system with periodic boundary conditions. The derivatives are based on spring forces and mechanical properties defined in p.\n\n\n\n\n\n","category":"method"},{"location":"Equations.html#TissueGrowth.ODE_fnc_2D!-NTuple{4, Any}","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.ODE_fnc_2D!","text":"ODE_fnc_2D!(du, u, p, t)\n\nDefine the ODE system for 2D mechanical relaxation with initial conditions. This function computes the derivatives du based on the current state u and parameters p.\n\nArguments\n\ndu: Array to store the derivatives of u.\nu: Current position array of all spring boundary nodes.\np: Parameters tuple (N, kₛ, η, kf, l₀, δt, growth_dir).\nt: Current time.\n\nDescription\n\nCalculates the mechanical relaxation and normal velocity in a 1D system with periodic boundary conditions. The derivatives are based on spring forces and mechanical properties defined in p.\n\n\n\n\n\n","category":"method"},{"location":"Equations.html#Equations-for-Mechanical-Relaxation-and-Normal-Velocity:","page":"System of ODEs (Discrete Model)","title":"Equations for Mechanical Relaxation and Normal Velocity:","text":"","category":"section"},{"location":"Equations.html","page":"System of ODEs (Discrete Model)","title":"System of ODEs (Discrete Model)","text":"TissueGrowth.Fₛ⁺(rᵢ, rᵢ₊₁, rᵢ₋₁, kₛ, l₀)\nTissueGrowth.Fₛ⁻(rᵢ, rᵢ₊₁, rᵢ₋₁, kₛ, l₀)\nTissueGrowth.Vₙ(rᵢ₋₁, rᵢ, rᵢ₊₁, kf, δt, type)","category":"page"},{"location":"Equations.html#TissueGrowth.Fₛ⁺-NTuple{5, Any}","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.Fₛ⁺","text":"Fₛ⁺(rᵢ, rᵢ₊₁, rᵢ₋₁, kₛ, l₀)\n\nCalculate the spring force (Nonlinear) for mechanical relaxation in the positive direction.\n\nArguments\n\nrᵢ: The current point in space.\nrᵢ₊₁: The point after the current point in space.\nrᵢ₋₁: The point before the current point in space.\nkₛ: Spring coefficient.\nl₀: Resting length of the spring.\n\nReturns\n\nThe spring force in the positive direction.\n\n\n\n\n\n","category":"method"},{"location":"Equations.html#TissueGrowth.Fₛ⁻-NTuple{5, Any}","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.Fₛ⁻","text":"Fₛ⁻(rᵢ, rᵢ₊₁, rᵢ₋₁, kₛ, l₀)\n\nCalculate the spring force (Nonlinear) for mechanical relaxation in the negative direction.\n\nArguments\n\nrᵢ: The current point in space.\nrᵢ₊₁: The point after the current point in space.\nrᵢ₋₁: The point before the current point in space.\nkₛ: Spring coefficient.\nl₀: Resting length of the spring.\n\nReturns\n\nThe spring force in the negative direction.\n\n\n\n\n\n","category":"method"},{"location":"Equations.html#TissueGrowth.Vₙ-NTuple{6, Any}","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.Vₙ","text":"Vₙ(rᵢ₋₁, rᵢ, rᵢ₊₁, kf, δt, type)\n\nCalculate the normal velocity of the interface such that Vₙ is proportional to ρ. The direction of the normal vector is determined by type.\n\nArguments\n\nrᵢ₋₁: The point before the current point in space.\nrᵢ: The current point in space.\nrᵢ₊₁: The point after the current point in space.\nkf: The amount of tissue produced per unit area per unit time.\nδt: The time step.\ntype: A string specifying the orientation of the normal vector, either \"inward\" or any other value for outward orientation.\n\nReturns\n\nThe normal velocity of the interface.\n\n\n\n\n\n","category":"method"},{"location":"Equations.html#Cell-behaviour-functions:","page":"System of ODEs (Discrete Model)","title":"Cell behaviour functions:","text":"","category":"section"},{"location":"Equations.html","page":"System of ODEs (Discrete Model)","title":"System of ODEs (Discrete Model)","text":"TissueGrowth.P(event,ρ,α)\nTissueGrowth.A(event,ρ,β)\nTissueGrowth.E(event,ρ,kf,γ)\nTissueGrowth.affect!(integrator)","category":"page"},{"location":"Equations.html#TissueGrowth.P-Tuple{Any, Any, Any}","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.P","text":"P(event, ρ, α)\n\nCalculate the probability of proliferation occurring, given the density ρ and the parameter α.\n\nIf the proliferation event is considered to occur (event is true), the probability is calculated as the product of ρ and α. Otherwise, a vector of zeros is returned.\n\nArguments\n\nevent: A boolean indicating whether the proliferation event is considered to occur.\nρ: A vector representing densities.\nα: Parameter for scaling the proliferation probability.\n\nReturns\n\nA vector representing the calculated probabilities for proliferation.\n\n\n\n\n\n","category":"method"},{"location":"Equations.html#TissueGrowth.A-Tuple{Any, Any, Any}","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.A","text":"A(event, ρ, β)\n\nCalculate the probability of apoptosis (cell death) occurring, given the density ρ and the parameter β.\n\nIf the apoptosis event is considered to occur (event is true), the probability is calculated as the product of ρ and β. Otherwise, a vector of zeros is returned.\n\nArguments\n\nevent: A boolean indicating whether the apoptosis event is considered to occur.\nρ: A vector representing densities.\nβ: Parameter for scaling the apoptosis probability.\n\nReturns\n\nA vector representing the calculated probabilities for apoptosis.\n\n\n\n\n\n","category":"method"},{"location":"Equations.html#TissueGrowth.E-NTuple{4, Any}","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.E","text":"E(event, ρ, γ)\n\nCalculate the probability of embedding occurring, given the density ρ and the parameter γ.\n\nIf the embedding event is considered to occur (event is true), the probability is calculated as the product of ρ and γ. Otherwise, a vector of zeros is returned.\n\nArguments\n\nevent: A boolean indicating whether the embedding event is considered to occur.\nρ: A vector representing densities.\nγ: Parameter for scaling the embedding probability.\n\nReturns\n\nA vector representing the calculated probabilities for embedding.\n\n\n\n\n\n","category":"method"},{"location":"Equations.html#TissueGrowth.affect!-Tuple{Any}","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.affect!","text":"affect!(integrator)\n\nUpdate the state of integrator based on probabilistic cellular events.\n\nThis function modifies integrator in place. It uses the parameters and state from integrator to compute probabilities for different cellular events: proliferation (prolif), death (death), and embedding (embed). Based on these probabilities and random draws, it updates the state of integrator.\n\nArguments\n\nintegrator: The integrator object containing the current state and parameters. The parameters are expected to be a tuple containing:\n\nReturns\n\nnothing. The function modifies integrator in place.\n\n\n\n\n\n","category":"method"},{"location":"Equations.html#Custom-modifier-and-Special-functions","page":"System of ODEs (Discrete Model)","title":"Custom modifier & Special functions","text":"","category":"section"},{"location":"Equations.html","page":"System of ODEs (Discrete Model)","title":"System of ODEs (Discrete Model)","text":"Base.insert!\nBase.deleteat!\nTissueGrowth.lineIntersection(rₘ₁, rₗ, rₘ₂, rᵣ)\nTissueGrowth.κ(rᵢ₋₁, rᵢ, rᵢ₊₁)\nTissueGrowth.Ω(p)","category":"page"},{"location":"Equations.html#Base.insert!","page":"System of ODEs (Discrete Model)","title":"Base.insert!","text":"Base.insert!(A::ElasticMatrix, col, xy)\n\nInsert a two-element vector xy into a specific column col of an ElasticMatrix A.\n\nThis function modifies the ElasticMatrix in place. It inserts the elements of xy into the underlying data of A at the positions corresponding to the specified column.\n\nArguments\n\nA::ElasticMatrix: The ElasticMatrix object to be modified.\ncol: The column index where the elements will be inserted.\nxy: A two-element vector containing the values to be inserted into the matrix.\n\nReturns\n\nThe modified ElasticMatrix A.\n\n\n\n\n\n","category":"function"},{"location":"Equations.html#Base.deleteat!","page":"System of ODEs (Discrete Model)","title":"Base.deleteat!","text":"Base.deleteat!(A::ElasticMatrix, col)\n\nDelete elements from a specific column col of an ElasticMatrix A.\n\nThis function modifies the ElasticMatrix in place. It removes the elements of the specified column from the underlying data of A.\n\nArguments\n\nA::ElasticMatrix: The ElasticMatrix object to be modified.\ncol: The column index from which the elements will be removed.\n\nReturns\n\nThe modified ElasticMatrix A.\n\n\n\n\n\n","category":"function"},{"location":"Equations.html#TissueGrowth.lineIntersection-NTuple{4, Any}","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.lineIntersection","text":"lineIntersection(rₘ₁, rₗ, rₘ₂, rᵣ)\n\nImplementation of geometric solution for moving a cell in the normal direction. Calculate the intersection points of two lines defined by points rₘ₁, rₗ and rₘ₂, rᵣ.\n\nThis function computes the intersection point of each pair of lines. If the lines are parallel (the determinant is zero), it returns the midpoint of rₘ₁ and rₘ₂. Otherwise, it calculates the intersection point using the parameters u and t. If the intersection lies within the segments, the intersection point is returned; otherwise, the midpoint is returned.\n\nArguments\n\nrₘ₁: Starting point of the first line segment.\nrₗ: Ending point of the first line segment.\nrₘ₂: Starting point of the second line segment.\nrᵣ: Ending point of the second line segment.\n\nReturns\n\nA vector of intersection points for each pair of line segments.\n\n\n\n\n\n","category":"method"},{"location":"Equations.html#TissueGrowth.κ-Tuple{Any, Any, Any}","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.κ","text":"κ(rᵢ₋₁, rᵢ, rᵢ₊₁)\n\nApproximate the curvature of a shape using the Menger method. This method is based on the areas of triangles formed by consecutive triplets of points.\n\nArguments\n\nrᵢ₋₁: The point before the current point in space.\nrᵢ: The current point in space.\nrᵢ₊₁: The point after the current point in space.\n\nReturns\n\nThe approximated curvature at the point rᵢ.\n\nReference\n\nAnoshkina, Elena V., Alexander G. Belyaev, and Hans-Peter Seidel. \"Asymtotic Analysis of Three-Point Approximations of Vertex Normals and Curvatures.\" VMV. 2002.\n\n\n\n\n\n","category":"method"},{"location":"Equations.html#TissueGrowth.Ω-Tuple{Any}","page":"System of ODEs (Discrete Model)","title":"TissueGrowth.Ω","text":"Ω(p)\n\nCalculate the area of a polygon defined by points in p.\n\nThis function computes the area using the shoelace formula. The polygon is defined by a set of points p, and the function iterates through these points to calculate the area.\n\nArguments\n\np: A matrix where each row represents a point of the polygon in 2D space.\n\nReturns\n\nThe absolute area of the polygon.\n\n\n\n\n\n","category":"method"},{"location":"PDEsolver.html#Contiunuum-model-(PDE-solver)","page":"Contiunuum model (PDE solver)","title":"Contiunuum model (PDE solver)","text":"","category":"section"},{"location":"PDEsolver.html","page":"Contiunuum model (PDE solver)","title":"Contiunuum model (PDE solver)","text":"For mid to high diffusivities (005leq D leq 1) we use the Finite Difference Upwinding (in space) scheme, and for low to mid diffusivities (0leq D leq 005) we use FVM following the Kruganov-Tadmor scheme (Alias & Buenzli, 2017). Note: The FVM solver is only implemented for solving domains in polar coordinates.","category":"page"},{"location":"PDEsolver.html#Finite-Difference-Solver-Functions","page":"Contiunuum model (PDE solver)","title":"Finite Difference Solver Functions","text":"","category":"section"},{"location":"PDEsolver.html#PDE-in-Cartesian-coordinates","page":"Contiunuum model (PDE solver)","title":"PDE in Cartesian coordinates","text":"","category":"section"},{"location":"PDEsolver.html","page":"Contiunuum model (PDE solver)","title":"Contiunuum model (PDE solver)","text":"TissueGrowth.FD_SolveContinuumLim_Cartesian(D, kf, A, ρ₀, growth_dir, Tmax, Xmax)","category":"page"},{"location":"PDEsolver.html#TissueGrowth.FD_SolveContinuumLim_Cartesian-NTuple{7, Any}","page":"Contiunuum model (PDE solver)","title":"TissueGrowth.FD_SolveContinuumLim_Cartesian","text":"SolveContinuumLim_Cartesian(D, kf, A, ρ₀, growth_dir, Tmax, Xmax)\n\nSolve the continuum limit of a discrete cell-based model using a semi-implicit scheme and finite differencing for discretization in Cartesian coordinates.\n\nThis function is used to simulate the dynamics of a growing cell population in a one-dimensional domain. It utilizes finite difference methods for spatial discretization and a semi-implicit scheme for time integration.\n\nArguments\n\nD::Float64: Diffusion coefficient.\nkf::Float64: Growth rate constant.\nA::Float64: A constant used in the continuum model.\nρ₀::Float64: Initial density of cells.\ngrowth_dir::String: Direction of growth; can be \"inward\" or \"outward\".\nTmax::Float64: Maximum time for the simulation.\nXmax::Float64: Maximum spatial extent in the x-direction.\n\nReturns\n\nx::Vector{Float64}: Vector of spatial positions.\nh::Matrix{Float64}: Matrix representing the height profile at each time step and spatial position.\nρ::Matrix{Float64}: Matrix representing the cell density at each time step and spatial position.\n\nImplementation Details\n\nThe function discretizes the time from T₀ (initially 0.0) to Tmax into N steps, and the spatial domain from X₀ (initially 0.0) to Xmax into M steps.\nIt initializes various matrices and vectors to store derivatives and variables.\nThe function sets initial conditions for the height profile h and density ρ.\nA loop over the time steps computes the finite differences and updates the variables according to the semi-implicit scheme.\nA cyclic tridiagonal matrix method is used to solve a linear system in each time step.\n\n\n\n\n\n","category":"method"},{"location":"PDEsolver.html#PDE-in-Polar-coordinates","page":"Contiunuum model (PDE solver)","title":"PDE in Polar coordinates","text":"","category":"section"},{"location":"PDEsolver.html","page":"Contiunuum model (PDE solver)","title":"Contiunuum model (PDE solver)","text":"TissueGrowth.FD_SolveContinuumLim_Polar(D,kf,A,ρ₀,Tmax,r₀,btype,growth_dir)","category":"page"},{"location":"PDEsolver.html#TissueGrowth.FD_SolveContinuumLim_Polar-NTuple{8, Any}","page":"Contiunuum model (PDE solver)","title":"TissueGrowth.FD_SolveContinuumLim_Polar","text":"SolveContinuumLim_Polar(D, kf, A, ρ₀, growth_dir, Tmax)\n\nSolve the continuum limit of a discrete cell-based model using a semi-implicit scheme and finite differencing for discretization.\n\nThis function is specifically designed for a polar coordinate system and is used to model the dynamics of a growing cell population in a circular domain. It employs finite difference methods for spatial discretization and a semi-implicit scheme for time integration.\n\nArguments\n\nD::Float64: Diffusion coefficient.\nkf::Float64: Growth rate constant.\nA::Float64: A constant used in the continuum model.\nρ₀::Float64: Initial density of cells.\ngrowth_dir::String: Direction of growth; can be \"inward\" or \"outward\".\nTmax::Float64: Maximum time for the simulation.\n\nReturns\n\nθ::Vector{Float64}: Vector of angular positions (in radians).\nR::Matrix{Float64}: Matrix representing the radial positions at each time step and angular position.\nρ::Matrix{Float64}: Matrix representing the cell density at each time step and angular position.\n\nImplementation Details\n\nThe function discretizes the time from T₀ (initially 0.0) to Tmax into N steps, and the angular domain from 0 to 2π into M steps.\nIt initializes various matrices and vectors to store derivatives and variables.\nThe function sets initial conditions for radial positions R and density ρ.\nA loop over the time steps computes the finite differences and updates the variables according to the semi-implicit scheme.\nA cyclic tridiagonal matrix method is used to solve a linear system in each time step.\n\n\n\n\n\n","category":"method"},{"location":"PDEsolver.html#FVM-Kruganov-Tadmor-Solver-Functions","page":"Contiunuum model (PDE solver)","title":"FVM Kruganov-Tadmor Solver Functions","text":"","category":"section"},{"location":"PDEsolver.html","page":"Contiunuum model (PDE solver)","title":"Contiunuum model (PDE solver)","text":"TissueGrowth.FVM_SolveContinuumLim_Polar(D,kf,A,ρ₀,Tmax,r₀,btype, growth_dir)","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"CurrentModule = TissueGrowth","category":"page"},{"location":"index.html#TissueGrowth.jl","page":"Home","title":"TissueGrowth.jl","text":"","category":"section"},{"location":"index.html","page":"Home","title":"Home","text":"TissueGrowth.jl is a open source project package developed to simulate the evoluition of biological tissue interface during tissue growth. This package is used to solve both the system of ODE's defined in the discrete model and the PDE derived through taking the continuum limit of the discrete model.","category":"page"},{"location":"index.html#Discrete-model-description","page":"Home","title":"Discrete model description","text":"","category":"section"},{"location":"index.html","page":"Home","title":"Home","text":"Our model considers mechanical interactions between neighbouring cells and a secretion rate of new tissue material that is proportional to cell density. In this project we include cell proliferation, apoptosis (death) and embedment as stochastic processes. This model is solved using the DifferentialEquations.jl and ElasticArrays.jl packages. The solver uses RK4() or Euler() solving algorithms with a constant timestep Delta t. The stochastic cell behaviour is implemented using a PeriodicCallback and occurs every delta t_textevent period of time. This package offers 1D and 2D simulations. In our case 1D simulations imply the evolution of a line segment which has periodic boundaries and 2D is a closed domain. In the case of 2D simulations you can choose an inward or outward growth simulation by setting the appropriate parameters.","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"Calculates the mechanical relaxation and normal velocity in a system with periodic boundary conditions. The derivatives are based on the discrete equation given by:","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"fractextdmathbfuᵢtextdt = frac1ηbigg((mathbfFₛ - mathbfFₛ)cdotbmτbigg)bmτ + Vₙmathbfn ","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"where,","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"mathbfFₛ = f(lVert mathbfuᵢ₁ - mathbfuᵢ rVert) fracmathbfuᵢ₁ - mathbfuᵢlVert mathbfuᵢ₁ - mathbfuᵢ rVert hspace05cm mathbfFₛ = f(lVert mathbfuᵢ - mathbfuᵢ₁ rVert) fracmathbfuᵢ - mathbfuᵢ₁lVert mathbfuᵢ - mathbfuᵢ₁ rVert","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"given f(lVert mathbfuᵢ₁ - mathbfuᵢ rVert) is the restoration force function and Vₙ is the velocity in the normal direction.","category":"page"},{"location":"index.html#Current-models-of-Mechanical-Relaxation-and-Normal-Velocity","page":"Home","title":"Current models of Mechanical Relaxation and Normal Velocity","text":"","category":"section"},{"location":"index.html","page":"Home","title":"Home","text":"In this current version of the simulation code we use a nonlinear resorting force given by,","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"f(lVert mathbfuᵢ₁ - mathbfuᵢ rVert) = kₛ^(m) bigg(frac1l_0 - frac1lVert mathbfuᵢ₁ - mathbfuᵢ rVert bigg)","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"and a normal velocity which is proportional to density such that,","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"Vₙ = k_f^(m)rho_i hspace05cm rho_i = frac1lVert mathbfuᵢ₁ - mathbfuᵢ rVert","category":"page"},{"location":"index.html#Continuum-model-description","page":"Home","title":"Continuum model description","text":"","category":"section"},{"location":"index.html","page":"Home","title":"Home","text":"To derive the continuum limit of the discrete model we consider a very large number of springs per cell such that mrightarrowinfty. There we are able to derive the evolution equation for spring density fracpartialrhopartial t and then transform the result into an evolution equation for cell density fracpartial qpartial t using the relationship between spring and cell density q(xt) = fracrho(xt)m. Using appropriate parameter scalings we derive the evolution equation of cell density to be,","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"fracpartial qpartial t = -fracpartial^2tildeF(q)partial s^2 - qV(q)kappa","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"the mechanical relaxation is given by the first term and can be rewritten using the chain rule to look like a nonlinear diffusion,","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":" -fracpartial^2tildeF(q)partial s^2 = fracpartialpartial sbigg(-fracpartialtildeF(q)partial qfracpartial qpartial sbigg)","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"Given the choice of the nonlinear restoring force in the discrete models we retain a linear diffusion where,","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"tildeF(q) = D(q_0 - q) hspace05cm D = frack_s^(1)eta^(1)q_0^2","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"V(q) = k_f^(1)q","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"fracpartial^2partial s^2","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"is the second derivative in terms of arc-length and bmgamma(xt) is an arbitrary parameterisation for the interface.","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"In cartesian form such that bmgamma = (xh(x)) there is an extra term such that,","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"fracpartial qpartial t = -fracpartial^2tildeF(q(xt))partial s^2 - q(xt)V(q(xt))kappa - bigg(fracbmgamma_tcdotbmhattaulVert bmgamma_t rVert bigg)fracpartial q(xt)partial x","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"For high to mid diffusivities i.e. 005 geq D leq 1 we use a Finite Difference upwinding scheme. ","category":"page"}]
